import React from 'react';
import '../Stylesheets/Header.css';

const Header = () => {
const cartItemQuantity = '';
const cartWithQuantity = `Cart (${cartItemQuantity})`;
return (
<nav>
<div className="navBar">
<a href='/' className='shopping-header'>Shopping</a>
<ul>
<li style={{ padding: '20px 20px' }}><a href='/'>Products</a></li>
<li style={{ padding: '0px 0px' }}><a href='/'>{cartWithQuantity}</a></li>
</ul>
</div>
</nav>
);
}

export default Header;
